(1, 'Villa Fifari', 1, 1, 'Harga untuk 1 kamar', 'Rp.106.875,00', '-7.873540083539073, 112.5323697963008', 'Hotel kasual dengan pemandangan gunung dan lembah yang terletak di taman rindang ini berjarak 6 menit berjalan kaki dari Museum Angkut dan 1 km dari taman hiburan Jawa Timur Park 1', 'VillaFifari.jpg', 'Tidak ada', 'Batu Permata Land kav 38, Jl. Diponegoro, Sisir, Batu, Batu City, East Java 65313', '+62341592955'),
(2, 'Villa Sedayu 2', 2, 1, 'Harga untuk 1 kamar', 'Rp.642.240,00', '-7.8922676770189515, 112.54379387290022', 'Terletak di Batu, 2,3 km dari Jatim Park 2 dan 2,6 km dari Balitjestro, Rumah Sedayu 2 menyediakan akomodasi dengan fasilitas seperti WiFi gratis dan TV layar datar. Berjarak 1,6 km dari Batu Night Spectacular, properti ini menawarkan taman dan parkir pribadi gratis.\r\n\r\nDilengkapi dengan pemutar DVD, vila ini memiliki dapur dengan kulkas dan kompor, ruang bersama, ruang makan, 3 kamar tidur, serta 2 kamar mandi dengan shower. Untuk menambah kenyamanan Anda, akomodasi ini dapat menyediakan handuk dan seprai dengan biaya tambahan.', 'Rumah-Sedayu2.jpg', 'Tidak Ada', 'Oro-Oro Ombo, Kec. Batu, Kota Batu, Jawa Timur 65316', '081252526692'),
(5, 'Orchid Boutique Villa', 4, 1, 'Harga Untuk 1 villa', 'IDR 1.928.000,00', '-7.865128213952394, 112.52281188725262', 'Orchid Boutique Villa menawarkan akomodasi dengan bar, lounge bersama, taman, dan pemandangan danau, serta berjarak sekitar 600 meter dari Batu Townsquare. Vila ini menyediakan akomodasi ber-AC dengan teras.\r\n\r\nVila ini memiliki dapur dengan mesin pencuci piring, kulkas, oven, ruang tamu dengan area tempat duduk dan ruang makan, 6 kamar tidur, serta 2 kamar mandi dengan bidet dan shower. TV satelit layar datar dan pemutar CD juga tersedia.\r\n\r\nFasilitas barbekyu dan teras tersedia untuk Anda gunakan di vila.\r\n\r\nMuseum Angkut berjarak 1,7 km dari Orchid Boutique Villa, sedangkan Taman Wisata Tirta Nirwana Songgoriti berjarak 2,1 km. Bandara terdekat adalah Bandara Abdul Rachman Saleh, 22 km dari akomodasi.', 'Orchid.jfif', 'Tidak Ada', 'Jl. Mawar No.60 A, Songgokerto, Kec. Batu, Kota Batu, Jawa Timur 65312', '6282643773421'),
(6, 'Villa kusuma estate batu', 4, 1, 'Harga Untuk 1 villa', 'IDR 1.928.000,00', '-7.8711084293777045, 112.52055358647141', 'Lokasi Dekat Wisata : Jatimpark 1, Jatimpark 2, BNS, Museum Angkut, Wisata Petik Apel', 'Estate.jpg', 'Ada', 'Jl. Abdul Gani No.9, Ngaglik, Kec. Batu, Kota Batu, Jawa Timur 65311', '082234335585'),
