(9, 'Vila Monex', 2, 1, 'Harga untuk 1 kamar', 'IDR 500.289,00', '-7.88550457162299, 112.53566945918877', 'Pukul berapa saya bisa check-in dan check-out di Vila Monex?\r\n\r\nCheck-in bisa dilakukan dari pukul 13:00, dan check-out sampai pukul 12:00. Anda bisa meminta check-in lebih awal atau check-out lebih lama saat melakukan pemesanan, tergantung persediaan. Tamu yang check-in atau check-out sebelum atau setelah waktu yang ditentukan dapat dikenakan biaya tambahan.\r\n\r\nBagaimana cara saya ke Vila Monex?\r\n\r\nBagi tamu yang ingin mengendarai mobil pribadi, Vila Monex menyediakan area parkir untuk tamu. Parkir tersedia gratis untuk tamu.', 'villamonex.jpg', 'Tidak ada', 'Jl. Dewi Sartika III.H kav.B8, Temas, Kec. Batu, Kota Batu, Jawa Timur 65315', '082137333373'),
(10, 'Villa Cemara', 2, 1, 'Harga Untuk 1 villa', 'IDR 1.000.000,00', '-7.873903340693454, 112.51841482715933', 'Anda bisa mendapat diskon Genius di Villa Cemara! Login untuk mendapatkannya.\r\n\r\nTerletak di Batu, 1,4 km dari Museum Angkut, Villa Cemara menyediakan akomodasi dengan lounge bersama, WiFi gratis, resepsionis 24 jam, dan dapur bersama. Vila ini berjarak 1,7 km dari Batu Townsquare dan menawarkan layanan kamar.\r\n\r\nVila dilengkapi dengan 6 kamar tidur, 3 kamar mandi, TV satelit layar datar, ruang makan, dapur lengkap, dan balkon dengan pemandangan taman.\r\n\r\nFasilitas barbekyu dan teras disediakan di vila.\r\n\r\nVilla Cemara berjarak 1,9 km dari Jatim Park 1 dan 2,2 km dari Taman Wisata Tirta Nirwana Songgoriti. Bandara terdekat adalah Bandara Abdul Rachman Saleh, 22 km dari akomodasi.', 'cemara.jpg', 'Tidak ada', 'Jl. Suropati No.79, Ngaglik, Kec. Batu, Kota Batu, Jawa Timur 65311', '+62895366605088'),
(11, 'Villa KenDedes Garden', 3, 2, 'Harga Untuk 1 villa', 'IDR 1.000.000,00', '-7.81962498391305, 112.52238511181733', 'Terletak di Batu, berjarak kurang dari 1 km dari Taman Rekreasi Selecta, Villa KenDedes Garden menawarkan akomodasi dengan lounge bersama, Wi-Fi gratis, resepsionis 24 jam, dan dapur bersama. Akomodasi ini berjarak 7 km dari Kali Watu Rafting dan menyediakan layanan kamar.\r\n\r\nVila ini memiliki pemutar DVD, dapur dengan kulkas, minibar, dan kompor, ruang tamu dengan area tempat duduk dan ruang makan, 6 kamar tidur, serta 2 kamar mandi dengan bidet dan shower. TV layar datar dan pemutar CD juga disediakan.', 'kendedes.jpg', 'Ada', 'Dusun Kekep RT05/RW05, Desa, Tulungrejo, Bumiaji, Batu City, East Java 65336', '+6281252091908'),
(15, 'mountview Villa', 5, 1, 'Harga Untuk 1 villa', 'IDR 4.750.000,00', '-7.884684446220998, 112.51395653880596', 'Batu Mountview Villa terletak di Batu, 200 meter dari Kusuma Agrowisata, dan menawarkan akomodasi dengan akses ke lounge bersama, fasilias barbeku, serta dapur bersama. Akomodasi ini menyediakan akses ke balkon, fasilitas pingpong, tempat parkir pribadi gratis, dan Wi-Fi gratis.\r\n\r\nVila ini memiliki pemutar DVD, dapur dengan microwave, kulkas, dan kompor, ruang tamu dengan area tempat duduk dan ruang makan, 5 kamar tidur, serta 4 kamar mandi dengan shower dan bathtub. Terdapat juga TV kabel layar datar.', 'mount.jpg', 'Ada', 'Jl. Abdul Gani Atas Komplek Villa Kencana Apel D6, Ngaglik, Kec. Batu, Kabupaten Malang, Jawa Timur 65311', ' 0811-316-881'),
(16, 'Candana Villa', 4, 1, 'Harga Untuk 1 villa', 'IDR 1.550.000,00', '-7.884275674522942, 112.51541854863878', 'Cendana Villa menawarkan akomodasi dengan kolam renang luar ruangan, taman, dan layanan kamar untuk kenyamanan Anda, 300 meter dari Kusuma Agrowisata. Wi-Fi dan tempat parkir pribadi dapat diakses di vila secara gratis.\r\n\r\nCendana Villa menyediakan teras, pemandangan kolam renang, area tempat duduk, TV satelit layar datar, dapur lengkap dengan kulkas dan kompor, dan kamar mandi pribadi dengan shower dan sandal. Balkon dengan pemandangan taman ditawarkan di semua unit.\r\n\r\nFasilitas barbekyu dan teras berjemur dapat ditemukan di akomodasi.\r\n\r\nJatim Park 1 berjarak 1,4 km dari Cendana Villa, sedangkan Museum Angkut berjarak 1,5 km. Bandara terdekat adalah Bandara Abdul Rachman Saleh, 22 km dari vila.\r\n\r\nKami berbicara bahasa Anda!', 'candana.jpg', 'Ada', 'Jl. Abdul Gani Atas, Ngaglik, Kec. Batu, Kota Batu, Jawa Timur 65311', '08231231233'),
(20, 'Comfort House at Villa Emerald Batu', 1, 5, 'Harga Untuk 1 villa', 'IDR 420.000,00', '-7.8954047134971646, 112.56207890543406', 'Omah enggil batu menawarkan taman dan pemandangan kota di Batu, 3 km dari Balitjestro dan 3,5 km dari Jatim Park 2. Akomodasi ber-AC ini berjarak 2,9 km dari Batu Night Spectacular, dan Anda dapat memanfaatkan tempat parkir pribadi yang tersedia di akomodasi dan Wi-Fi gratis.\r\n\r\nVila ini memiliki 2 kamar tidur, 2 kamar mandi, TV satelit layar datar, ruang makan, dapur lengkap, dan balkon dengan pemandangan taman.\r\n\r\nTeras tersedia untuk Anda gunakan.\r\n\r\nJatim Park 1 berjarak 4,2 km dari Omah enggil batu, sedangkan Kali Watu Rafting berjarak 4,4 km. Bandara terdekat adalah Bandara Abdul Rachman Saleh, 17 km dari akomodasi.', 'emerald.jpg', 'Tidak ada', 'Jl. Wilis Gg. VI No.1, Sisir, Kec. Batu, Kota Batu, Jawa Timur 65314', ' 0851-0277-7025'),
(21, 'Villa Panderman Indah', 1, 1, 'Harga untuk 1 kamar', 'IDR 285.000,00', '-7.88550941098388, 112.5142241676166', 'ne of our top picks in Batu.Panderman Indah is set in Batu, a 4-minute walk from Agro tourism Kusuma and a 12-minute walk from Angkut Museum. Popular points of interest nearby include Jatim Park 1 and Jatim Park 2. The property is situated 1.4 miles from Batu Townsquare.\r\n\r\nAt the hotel, rooms are fitted with a balcony with a mountain view. Panderman Indah features some rooms with pool views, and all rooms are fitted with a private bathroom.\r\n\r\nThe daily breakfast offers Asian and halal options.\r\n\r\nThe accommodation offers a terrace. You can play billiards at this 2-star hotel.\r\n\r\nThe reception can provide advice on the area in order to help guests plan their day.\r\n\r\nTaman Wisata Tirta Nirwana Songgoriti is 1.6 miles from Panderman Indah. The nearest airport is Abdul Rachman Saleh Airport, 14.3 miles from the hotel.\r\n\r\n', 'panderman.jpg', 'Tidak ada', 'No.9 Ngaglik Batu 65314, Jl. Abdul Gani Atas, Ngaglik, Kec. Batu, Kota Batu, Jawa Timur 65314', '(0341) 5103951'),
(23, 'VILLA BLOSSOM. KAYANA REGENCY E7', 2, 5, 'Harga Untuk 1 villa', 'IDR 539.500,00', '-7.904808849024489, 112.5635052694891', 'Villa Blossom Kayana Regency E7 menawarkan akomodasi ber-AC di Batu, 5 km dari Batu Night Spectacular dan 6 km dari Jatim Park 1. Terletak 4 km dari Balitjestro, akomodasi ini menyediakan taman dan parkir pribadi gratis.\r\n\r\nVila ini dilengkapi dengan 2 kamar tidur, 1 kamar mandi, seprai, handuk, TV layar datar dengan saluran kabel, ruang makan, dapur lengkap, dan teras dengan pemandangan taman.\r\n\r\nBatu Townsquare dan Jatim Park 2 berjarak 6 km dari vila. Bandara terdekat adalah Bandara Abdul Rachman Saleh, 17 km dari Villa Blossom Kayana Regency E7.\r\n\r\nKami berbicara bahasa Anda!', 'kayana.jpg', 'Tidak ada', '3HV7+X9G, Mojorejo, Junrejo, Batu City, East Java 65322', '+6282232024005'),
(24, 'Villa Alcola', 5, 1, 'Harga Untuk 1 villa', 'IDR 5.377.778,00', '-7.8915794408638105, 112.51924750997064', 'Villa Alcola menawarkan akomodasi di Batu, 700 meter dari Kusuma Agrowisata, dengan akses ke kolam renang luar ruangan, lounge bersama, serta dapur bersama. Vila ini memiliki kolam renang pribadi, taman, fasilitas barbekyu, Wi-Fi gratis, dan parkir pribadi gratis.\r\n\r\nVila ini dilengkapi dengan 3 kamar tidur, dapur dengan mesin pencuci piring dan kulkas, TV layar datar, area tempat duduk, dan 3 kamar mandi yang dilengkapi dengan hot tub. Handuk dan seprai juga disediakan di akomodasi.\r\n\r\nTerdapat juga teras yang dapat Anda gunakan.\r\n\r\nJatim Park 1 berjarak 1,8 km dari Villa Alcola, sedangkan Museum Angkut berjarak 1,9 km dari akomodasi. Bandara terdekat adalah Bandara Abdul Rachman Saleh, 22 km dari akomodasi.', 'alcola.jpg', 'Ada', 'Jl. Gandaria No.kav 320, Sisir, Kec. Batu, Kota Batu, Jawa Timur 65311', '+62818327883'),
(25, 'Villa Calista Batu', 2, 1, 'Harga Untuk 1 villa', 'IDR 660.289,00', '-7.860939465996697, 112.52233122346415', 'Villa Calista Batu adalah akomodasi dengan pemandangan kota yang terletak di Batu, 1,7 km dari Kali Watu Rafting dan 2 km dari Museum Angkut. Menyediakan parkir pribadi gratis, akomodasi ini berjarak 1,2 km dari Batu Townsquare dan 1,5 km dari Taman Wisata Tirta Nirwana Songgoriti.\r\n\r\nVila ini menawarkan teras, pemandangan taman, 3 kamar tidur, ruang bersama, TV kabel layar datar, dapur lengkap, serta 1 kamar mandi dengan bidet dan shower.\r\n\r\nJatim Park 1 berjarak 2,5 km dari vila, sedangkan Kusuma Agrowisata berjarak 2,6 km. Bandara terdekat adalah Bandara Abdul Rachman Saleh, 22 km dari Villa Calista Batu.\r\n\r\nKami berbicara bahasa Anda!', 'green.jpg', 'Tidak ada', 'Jalan Metro, Perum Metro Indah Regency Kav A11, Kota Batu, Jawa Timur 65314', '+6285271822969'),
(26, 'Blessed villa Homestay', 4, 1, 'Harga Untuk 1 villa', 'IDR 1.971.000,00', '-7.882973300235169, 112.52314643880582', 'Villa Homestay Blessed Agro Kusuma Batu Malang 5 bedrooms menawarkan teras dengan pemandangan taman, lounge bersama, dan teras di Batu, dekat dengan Museum Angkut dan berjarak kurang dari 1 km dari Jatim Park 1. Vila ini memiliki taman, fasilitas barbekyu, Wi-Fi gratis, dan parkir pribadi gratis.\r\n\r\nVila ini memiliki dapur dengan kulkas dan kompor, pemutar DVD, ruang tamu dengan area tempat duduk dan ruang makan, 5 kamar tidur, serta 4 kamar mandi dengan shower dan bathtub. TV satelit layar datar dan pemutar CD juga ditawarkan.\r\n\r\nTempat-tempat menarik yang populer di dekat vila termasuk pariwisata Agro Kusuma, Batu Townsquare, dan Jatim Park 2. Bandara terdekat adalah Bandara Abdul Rachman Saleh, 22 km dari Villa Homestay Blessed Agro Kusuma.\r\n\r\nKami berbicara bahasa Anda!', 'homestay.jpg', 'Tidak Ada', 'Perum agro kusuma estate, Jl. Abdul Gani Atas No.72, Sisir, Kec. Batu, Kota Batu, Jawa Timur 65314', '08231231222'),
(27, 'REESTY VILLA', 5, 2, 'Harga Untuk 1 villa', 'IDR 2.750.000,00', '-7.863893251763747, 112.54047419647634', 'Terletak di Batu di wilayah Jawa Timur, REESTY VILLA KOLAM RENANG DENGAN VIEW GUNUNG memiliki balkon dan pemandangan taman. Akomodasi ini berjarak 400 meter dari Kali Watu Rafting.\r\n\r\nVila ini dilengkapi dengan 4 kamar tidur, TV layar datar, dan dapur. Handuk dan seprai juga disediakan.\r\n\r\nAnda dapat bersantai di taman di akomodasi.\r\n\r\nBatu Townsquare berjarak 1,7 km dari vila, sedangkan Jatim Park 1 berjarak 2,8 km. Bandara terdekat adalah Bandara Abdul Rachman Saleh, 20 km dari akomodasi.', 'reesty.jpg', 'Ada', 'Jl. Raya Bukit Berbunga, Pandanrejo, Kec. Bumiaji, Kota Batu, Jawa Timur 65332', '+6285244086665'),
(28, 'The cendana villa’s', 5, 1, 'Harga Untuk 1 villa', 'IDR 3.550.000,00', '-7.88554889190586, 112.5185304964766', 'Terletak di Batu, 200 meter dari Kusuma Agrowisata, The cendana villa’s menawarkan pemandangan gunung, WiFi gratis, dan parkir pribadi gratis.\r\n\r\nSemua unit memiliki area tempat duduk, TV satelit layar datar, serta kamar mandi pribadi dengan amenitas kamar mandi gratis dan shower.\r\n\r\nVila ini menawarkan hot tub.\r\n\r\nLayanan rental mobil tersedia di The cendana villa’s.\r\n\r\nAkomodasi berjarak kurang dari 1 km dari Jatim Park 1 dan 13 menit jalan kaki dari Museum Angkut. Bandara terdekat adalah Bandara Abdul Rachman Saleh, 22 km dari The cendana villa’s.\r\n\r\nKami berbicara bahasa Anda!', 'cendana.jpg', 'Ada', '4G79+MCJ, Ngaglik, Kec. Batu, Kota Batu, Jawa Timur 65311', '+628123263245'),
(29, 'Villa Green Apple', 2, 1, 'Harga Untuk 1 villa', 'IDR 645.200,00', '-7.893617055456897, 112.5326841305781', 'Green Apple Villa terletak strategis hanya 5 menit berkendara dari Jatim Park 2 Theme Park, menawarkan akomodasi yang nyaman dengan parkir pribadi gratis di tempat untuk Anda yang membawa kendaraan.\r\n\r\nAkomodasi ini berselang 10 menit berkendara ke Museum Angkut, sementara bandara internasional Juanda dapat dicapai dengan 1,5 jam perjalanan naik mobil.\r\n\r\nUnit akomodasinya menyediakan TV dan balkon. Terdapat dapur lengkap dengan lemari es dan meja makan. Kamar mandi pribadinya menyediakan shower. Anda dapat menikmati pemandangan pegunungan dan pemandangan kota dari semua kamar.\r\n\r\nKami berbicara bahasa Anda!', 'green.jpg', 'Tidak ada', 'Jl. Bukit Panderman Hill Jl. Apel I No.180, Sisir, Kec. Batu, Kota Batu, Jawa Timur 65316', '087780221739'),
(30, 'Quincy Villa Panderman Hills (3BR)', 2, 1, 'Harga Untuk 1 villa', 'IDR 700.399,00', '-7.890661013050831, 112.52810928113524', 'Berjarak 300 meter dari Jatim Park 2, Quincy Villa Panderman Hills (3BR) menawarkan akomodasi di Batu dengan akses ke kolam renang indoor. Vila ini memiliki kolam renang pribadi, taman, dan parkir pribadi gratis.\r\n\r\nVila ini terdiri dari balkon, 4 kamar tidur, dan dapur lengkap.\r\n\r\nTeras ditawarkan di vila ini.\r\n\r\nAtraksi wisata yang populer di dekat Quincy Villa Panderman Hills (3BR) termasuk Jatim Park 1, Batu Night Spectacular, dan Balitjestro. Bandara terdekat adalah Bandara Abdul Rachman Saleh, 21 km dari akomodasi.', 'quincy.jpg', 'Ada', 'Jl. Bukit Panderman Hill, Oro-Oro Ombo, Kec. Batu, Kota Batu, Jawa Timur 65316', '+6289522370809'),
(32, 'Azcarya Villa', 5, 1, 'Harga Untuk 1 villa', 'IDR 2.714.657,00', '-7.892900896057947, 112.51603908298277', 'Azcarya Villa di Batu menyediakan akomodasi dengan pemandangan kolam renang, kolam renang luar ruangan, lounge bersama, taman, fasilitas barbekyu, dan teras.\r\n\r\nSetiap unit dilengkapi dengan sofa, area tempat duduk, TV layar datar dengan saluran satelit, dapur lengkap dengan ruang makan, dan kamar mandi pribadi dengan sandal. Untuk menambah kenyamanan, akomodasi ini dapat menyediakan handuk dan seprai dengan biaya tambahan.\r\n\r\nKusuma Agrowisata berjarak 1,3 km dari vila, sedangkan Jatim Park 1 berjarak 2,5 km. Bandara terdekat adalah Bandara Abdul Rachman Saleh, 22 km dari Azcarya Villa.', 'Azcarya.jpg', 'Ada', 'Jl. Langsep, Sisir, Kec. Batu, Kota Batu, Jawa Timur 65311', '+628123405677'),
(33, 'The Singhasari Resort Batu ', 3, 5, 'Harga untuk 1 kamar', 'Rp.911.000,00', '-7.892875941662969, 112.55013889462916', 'The Singhasari Resort Batu menawarkan akomodasi bintang 5 dengan kolam renang luar ruangan, restoran, dan berbagai fasilitas rekreasi. Wi-Fi tersedia gratis di area umum.\r\n\r\nSinghasari Batu Resort dapat dicapai dalam 15 menit berkendara dari Jatim Park dan Batu Night Spectacular. Akomodasi ini dapat dicapai dalam 20 menit berkendara dari Stasiun Kereta Kota Baru dan 30 menit berkendara dari Gunung Panderman.\r\n\r\nDilengkapi balkon, kamar-kamarnya menampilkan interior modern. Semua kamar menawarkan TV kabel, area tempat duduk dengan sofa, dan ruang makan. Fasilitas shower dan perlengkapan mandi gratis tersedia di kamar mandi dalamnya.\r\n\r\nAnda dapat bermain tenis, berolahraga di gym, atau menikmati layanan pijat di spa. Rental mobil dan sepeda disediakan di meja layanan wisata.\r\n\r\nKutaraja Restaurant menyajikan pilihan hidangan lokal, Asia, dan Eropa. Layanan kamar juga tersedia jika Anda ingin bersantap di dalam kamar.\r\n\r\n', 'singhasari.jpg', 'Ada', 'Jl. Ir. Soekarno No.120, Beji, Kec. Batu, Kota Batu, Jawa Timur 65236', '+62341513333'),
(34, 'Tjunduk Djiwanta Family House', 2, 1, 'Harga Untuk 1 villa', 'IDR 569.900,00', '-7.861411009813056, 112.50550988420605', 'Terletak di Batu, hanya berjarak 700 meter dari Taman Wisata Tirta Nirwana Songgoriti, Tjunduk Djiwanta Family House menawarkan akomodasi dengan akses ke lounge bersama, taman, serta dapur bersama. Akomodasi berjarak 3,1 km dari Batu Townsquare, dan Anda mendapatkan keuntungan dari parkir pribadi dan Wi-Fi gratis.\r\n\r\nRumah liburan memiliki 4 kamar tidur, 3 kamar mandi, TV layar datar dengan saluran satelit, ruang makan, dapur lengkap, dan balkon dengan pemandangan taman.\r\n\r\nRumah liburan ini menawarkan taman bermain anak-anak, fasilitas barbekyu, dan teras.\r\n\r\nKusuma Agrowisata berjarak 3,3 km dari Tjunduk Djiwanta Family House, sementara Museum Angkut berjarak 4,1 km dari akomodasi. Bandara terdekat adalah Bandara Abdul Rachman Saleh, 24 km dari akomodasi.', 'Tjunduk.jpg', 'Tidak ada', 'Jl. Trunojoyo Gg. II E No. H-2, Songgokerto, Kec. Batu, Kota Batu, Jawa Timur 65312', '+6281334681140'),
(35, 'Villa Penny II', 1, 1, 'Harga Untuk 1 villa', 'IDR 472,500 ', '-7.888330820784251, 112.53197980997062', 'Villa Penny II menawarkan teras dan pemandangan kota di Batu, 300 meter dari Jatim Park 2 dan 1 km dari Batu Night Spectacular. Akomodasi ini menawarkan akses ke balkon dan parkir pribadi gratis.\r\n\r\nRumah liburan ini memiliki 3 kamar tidur, ruang tamu, TV layar datar, dapur lengkap dengan ruang makan, serta 1 kamar mandi dengan shower dan mesin cuci.\r\n\r\nJatim Park 1 berjarak 1,3 km dari rumah liburan, sedangkan Balitjestro berjarak 2 km. Bandara terdekat adalah Bandara Abdul Rachman Saleh, 21 km dari Villa Penny II.', 'penny.jpg', 'Tidak Ada', 'Gg. Pesantren, Temas, Kec. Batu, Kota Batu, Jawa Timur 65315', '+6281233280060'),
(36, 'Shanty\'s House', 2, 1, 'Harga Untuk 1 villa', 'IDR 900.000,00', '-7.8470968106463435, 112.53041012531148', 'Shanty\'s House menawarkan rumah liburan dengan teras di Batu, 2 km dari Kali Watu Rafting. Akomodasi dengan suguhan pemandangan gunung ini berjarak 2,6 km dari Batu Townsquare. Tempat parkir pribadi tersedia secara gratis di area properti.\r\n\r\nShanty\'s House menawarkan dapur yang dilengkapi lemari es dan kompor. Terdapat TV layar datar di akomodasi. Fasilitas lain yang ditawarkan termasuk fasilitas barbekyu.\r\n\r\nTaman Rekreasi Selecta terletak 2,7 km dari Shanty\'s House, dan Taman Wisata Tirta Nirwana Songgoriti berjarak 3,1 km Stasiun KA Malang Kota Baru berjarak 25 km. Bandara Abdul Rachman Saleh berjarak 30 km dari properti.', 'shanty.jpg', 'Tidak ada', 'Jl. Nitijayin 31A, Dusun Grinting, Desa, Bulukerto, Kec. Batu, Kota Batu, Jawa Timur 65334', '+6282333193029'),
(37, ' The Onsen Hot Spring Resort ', 5, 1, 'Harga Untuk 1 villa', 'IDR 2.000.000,00', '-7.864466891703054, 112.49901458298241', 'Menawarkan taman, teras, dan pemandangan taman, The Onsen Hot Spring Resort terletak di Batu, 2,1 km dari Taman Wisata Tirta Nirwana Songgoriti. Berbagai fasilitas yang tersedia di akomodasi ini adalah restoran, layanan kamar, resepsionis 24 jam, dan Wi-Fi gratis. Ryokan ini memiliki kamar keluarga.\r\n\r\nSemua unit di ryokan ini memiliki area tempat duduk, TV kabel layar datar, serta kamar mandi bersama dengan bathrobe dan shower. Semua kamar menyediakan meja kerja dan teko untuk Anda.\r\n\r\nThe Onsen Hot Spring Resort menyediakan sarapan à la carte setiap hari.\r\n\r\nAnda dapat menggunakan pemandian air panas di akomodasi ini.\r\n\r\nBatu Townsquare berjarak 4,4 km dari The Onsen Hot Spring Resort, sedangkan Kusuma Agrowisata berjarak 5 km. Bandara terdekat adalah Bandara Abdul Rachman Saleh, 25 km dari ryokan, dan tersedia layanan shuttle bandara berbayar.', 'onsen.jpg', 'Tidak Ada', 'Jl. Arumdalu No.98, Songgokerto, Kec. Batu, Kota Batu, Jawa Timur 65312', '+623415101888'),
(38, 'Kusuma Agrowisata Resort & Convention', 1, 1, 'Harga untuk 1 kamar', 'IDR 321.356,00', '-7.883474310202261, 112.51557143695824', 'Terletak di Batu, Malang, Kusuma Agrowisata Resort menawarkan spa, kolam renang outdoor, dan lapangan tenis. Akses Wi-Fi gratis tersedia di seluruh area hotel. Semua kamar menawarkan teras dengan pemandangan taman.\r\n\r\nSetiap kamar menawarkan fasilitas membuat teh/kopi dan kamar mandi pribadi dengan peralatan mandi. Beberapa kamarnya dilengkapi dengan TV layar datar.\r\n\r\nKusuma Agrowisata Resort and Convention hanya 45 menit berkendara dari Kota Malang dan Bandara Abdulrahman Saleh. Kota Surabaya berjarak 2 jam berkendara dari hotel.\r\n\r\nAnda bisa berwisata kuda atau menikmati pijat relaksasi. Penitipan bagasi tersedia di meja depan 24 jam. Ada sebuah toko suvenir di hotel.\r\n\r\nAneka masakan ala Indonesia dan Barat disajikan di restoran. Tersedia pula layanan kamar.', 'ksusuma.jpg', 'Ada', 'Kawasan Wisata Kusuma Agro, Jalan Abdul Gani Atas, Ngaglik, Kecamatan Batu, Ngaglik, Batu, Batu City, East Java 65311', '+628001593333'),
(39, 'Permata Villa II ', 5, 1, 'Harga Untuk 1 villa', 'IDR 2.200.000,00', '-7.884476426865966, 112.51373996948873', 'Permata Villa II terletak di Batu dan memiliki kolam renang luar ruangan, lounge bersama, taman, serta akomodasi dengan Wi-Fi gratis dan pemandangan danau. Akomodasi ini menawarkan akses ke fasilitas pingpong, lempar dart, dan tempat parkir pribadi gratis.\r\n\r\nRumah liburan ini memiliki 7 kamar tidur, TV satelit layar datar, dapur berperalatan lengkap dengan microwave dan kulkas, mesin cuci, serta 8 kamar mandi dengan shower. Untuk menambah kenyamanan Anda, akomodasi ini dapat menyediakan handuk dan seprai dengan biaya tambahan.\r\n\r\nRumah liburan ini menawarkan akomodasi bintang 3 dengan kolam renang dalam ruangan dan fasilitas barbeku. Permata Villa II memiliki teras.\r\n\r\nAtraksi wisata yang populer di dekat akomodasi ini termasuk Kusuma Agrowisata, Jatim Park 1, dan Museum Angkut. Bandara terdekat adalah Bandara Abdul Rachman Saleh, 23 km dari Permata Villa II.', 'permata.jpg', 'Ada', 'Jl. Abdul Gani, Ngaglik, Kec. Batu, Kota Batu, Jawa Timur 65311', '+6281252974011'),
(40, 'Riverstone Hotel & Cottage', 1, 1, 'Harga untuk 1 kamar', 'IDR 360.000,00', '-7.882210444951881, 112.52935464065348', 'Riverstone Hotel & Cottage terletak di Oro Oro Ombo, Batu, 600 meter dari Jatim Park 1, 1 km dari Jatim Park 2, dan 16 menit berjalan kaki dari Museum Angkut. Fasilitas yang ditawarkan di akomodasi ini meliputi restoran, resepsionis 24 jam, layanan kamar, dan Wi-Fi gratis. Tempat parkir pribadi dapat diatur dengan biaya tambahan.\r\n\r\nSemua kamar dilengkapi dengan AC, TV layar datar dengan saluran kabel, teko, shower, sandal, dan meja. Kamar-kamar di hotel ini memiliki lemari pakaian dan kamar mandi pribadi.\r\n\r\nAnda dapat menikmati sarapan prasmanan atau ala carte.\r\n\r\nBatu Townsquare berjarak 1,6 km dari akomodasi, sedangkan Batu Night Spectacular berjarak 1,8 km. Bandara terdekat adalah Bandara Abdul Rachman Saleh, 21 km dari Riverstone Hotel & Cottage.', 'riverstone.jpg', 'Tidak ada', 'Jl. Agus Salim No.97, Temas, Kec. Batu, Kota Batu, Jawa Timur 65316', '+62341524414'),
(41, 'Ken\'s Villa 8 ', 4, 1, 'Harga Untuk 1 villa', 'IDR 1.650.000,00', '-7.875338003223335, 112.51213548113502', 'Ken\'s Villa 8 terletak di Batu, 1,3 km dari Taman Wisata Tirta Nirwana Songgoriti. Rumah liburan ini menawarkan akomodasi dengan lounge bersama, Wi-Fi gratis, resepsionis 24 jam, dan dapur bersama. Akomodasi ini berjarak 1,5 km dari Kusuma Agrowisata, dan memiliki taman serta parkir pribadi gratis.\r\n\r\nRumah liburan ini memiliki balkon dan pemandangan taman, 2 kamar tidur, ruang tamu, TV satelit, dapur lengkap, serta 1 kamar mandi dengan shower.\r\n\r\nTerdapat teras di akomodasi ini. Anda dapat melakukan kegiatan hiking di dekat rumah liburan ini.\r\n\r\nKen\'s Villa 8 berjarak 2,2 km dari Batu Townsquare dan 2,3 km dari Museum Angkut. Bandara terdekat adalah Bandara Abdul Rachman Saleh, 23 km dari akomodasi.', 'kenns.jpg', 'Tidak Ada', 'Perumahan Wijaya Kusuma Atas No 8 Jl Suropati Gg 9 Pesanggrahan, Pesanggrahan, Kec. Batu, Kota Batu, Malang, Jawa Timur 65313', '+6282331733777'),
(46, 'Villa Mulyono', 3, 2, 'Harga Untuk 1 villa', 'IDR 1.326.476,00', '-7.832623367951679,112.53307700157166', 'Di Sekitar Properti\r\n\r\nTaman Wisata Selecta\r\nAktivitas & Permainan\r\n2.16 km\r\n\r\nMie Setan Express Batu\r\nCasual Dining\r\n2.31 km\r\n\r\nKantor Kepala Desa Pandanrejo\r\nBisnis\r\n3.47 km\r\n\r\nTerminal Kota Batu\r\nPusat Transportasi\r\n5.39 km', 'mulyono.jpeg', 'Tidak ada', 'Jl. Salam Bulukerto Bumiaji, Batu, Batu, Malang, Jawa Timur, Indonesia, 65334', '+6282237467322'),
